import React, { useEffect, useState } from "react";

import "../Homepage/Homepage.css"
function Homepage(){

const [error, setError]=useState(null);

const [stocks,setStocks]=useState([]);


useEffect(()=>{

    fetch("http://localhost:8000/all-stocks")
    .then(res=>res.json())
    .then(
        (result)=>{

            setStocks(result);
        },
        (error)=>{
            setError(error);


        }
    )
},[])
    return (

        <>

        <table>
            <tr>Stock Name</tr>
            <tr>Transaction Type</tr>
            <tr>Amount</tr>
            <tr>Transaction Date</tr>
{
    stocks.map(item=>(

       <tr>

           <td>

               {item.stockname}
           </td>
           <td>
             {item.transactiontype}  
           </td>
<td>


    {item.quantity}
</td>

<td>
    {item.amount}

</td>

<td>
    {item.transactiondate}
</td>

       </tr>
    ))
}
</table>
        </>
    );
}

export default Homepage;
